%[text] ## Parameters
%[text] ### Reading the parameters from COMSOL
%[text] **Description**: This block reads the parameters from the design in COMSOL. The parameters in COMSOL are defined as global in '`Model Builder/Global Definitions/Parameters`'. The counterpart variables in Matlab follow the same names as the parameters defined in COMSOL. The parameters are first exported in COMSOL to the csv file 'parameters\_2D.csv', which comprises a table where the first column refers to the parameters name, and the second column to their value. This code calls the function getVarTable  to read the value of the parameter and their units from this table. Units in this code follows the CSG units, as such units in COMSOL must be converted to CSG. For instance, the units of milimeters must be converted to meters with the factor $10^{-3}$, and similarly with the other units.
% Specify the MAT file for the parameters
csvFileName = 'parameters_2D.csv';
%entry from the table
opts=detectImportOptions(csvFileName,'ReadVariableNames', false);
% preview(csvFileName,opts) %data file preview
table=readtable(csvFileName,opts);

%define and initialize to zero the parameters of interest
%geometric parameters
radius_cylinder_1=0;
width_cylinder_in_1=0;
width_cylinder_out_1=0;
angle_turn_1_rad=0;
r_in_1=0;
r_out_1=0;
L=0;%total widht of the rectangle pipe
%flow parameters
p0=0;%this is derived from COMSOL parameters if the Inlet  specify the pressure level within the Laminar Flow(spf), otherwise it must be recalculated.
v0=0;%this is derived from COMSOL parameters if the Inlet  specify the velocity level within the Laminar Flow(spf), otherwise it must be recalculated.
%Sodium parameters
c_CH3COOH_ini=0;%concentration of released particles
D_CH3COOH=0;
c_Na=0;%concentration of released particles
D_Na=0;%diffusion coefficient of released particles
d_Na=0;%diameter of the released particles
M_Na=0;%molar mass of the released particles
rho_Na=0;%density of released particles
time_delta=0;%sampling time
time_simul=0;%total simulation time
T=293.15;%default model input in Kelvin
L_inner=0;
L_outer=0;

%reading the parameters from the COMSOL file
[var,factor]=getVarTable(width_cylinder_in_1,table);
width_cylinder_in_1=eval(var{1})*factor %[output:46c3bd8d]
[var,factor]=getVarTable(width_cylinder_out_1,table);
width_cylinder_out_1=eval(var{1})*factor %[output:50689ac3]
[var,factor]=getVarTable(radius_cylinder_1,table);
radius_cylinder_1=eval(var{1})*factor %[output:8f47bb17]
[var,factor]=getVarTable(angle_turn_1_rad,table);
angle_turn_1_rad=eval(var{1})*factor %[output:0f0491ce]
[var,factor]=getVarTable(r_in_1,table);
r_in_1=eval(var{1})*factor %[output:2cf30be7]
[var,factor]=getVarTable(r_out_1,table);
r_out_1=eval(var{1})*factor %[output:2b737216]
[var,factor]=getVarTable(p0,table);
p0=eval(var{1})*factor %[output:40aeec68]
[var,factor]=getVarTable(v0,table);
v0=eval(var{1})*factor %[output:743f8775]
[var,factor]=getVarTable(c_Na,table);
c_Na=eval(var{1})*factor %[output:4ef8bed6]
[var,factor]=getVarTable(c_CH3COOH_ini,table);
c_CH3COOH_ini=eval(var{1})*factor %[output:942e8c31]
[var,factor]=getVarTable(D_CH3COOH,table);
D_CH3COOH=eval(var{1})*factor %[output:28902435]
[var,factor]=getVarTable(D_Na,table);
D_Na=eval(var{1})*factor %[output:44fb8b28]
[var,factor]=getVarTable(M_Na,table);
M_Na=eval(var{1})*factor %[output:04a3ae7d]
[var,factor]=getVarTable(rho_Na,table);
rho_Na=eval(var{1})*factor %[output:6113d95d]
[var,factor]=getVarTable(time_delta,table);
time_delta=eval(var{1})*factor %[output:637edfb7]
[var,factor]=getVarTable(time_simul,table);
time_simul=eval(var{1})*factor %[output:7ffd349c]
[var,factor]=getVarTable(L_inner,table);
L_inner=eval(var{1})*factor %[output:36c60d93]
[var,factor]=getVarTable(L_outer,table);
L_outer=eval(var{1})*factor %[output:421315f8]

%[text] ### Evaluating the water viscosity 
%[text] **Description:** This evaluates the water viscosity as follows from the analytic function in COMSOL; which is a function of the temperature. The water viscosity is found in COMSOL in '`Component 1/Geometry/Water/rho`'. In this simulation water is the fluid medium where the particles moves.
%Evaluating the water viscosity as follows from the COMSOL definition
% Specify the MAT file for the density
csvFileName = 'viscosity_H2O.csv';
%entry from the table
opts=detectImportOptions(csvFileName,'ReadVariableNames', false);
% preview(csvFileName,opts) %data file preview
table_viscosity=readtable(csvFileName,opts);
str=table_viscosity{1,3};
mu_Water=eval(str{1}) %[output:14cd9adf]
%[text] ### Evaluating the water density 
%[text] **Description:** This evaluates the water density as follows from the analytic function in COMSOL, which is a function of the temperature. The water density is found in COMSOL in '`Component 1/Geometry/Water/rho`'. In this simulation water is the fluid medium where the particles moves.
%Evaluating the water density as follows from the COMSOL definition
% Specify the MAT file for the viscosity
csvFileName = 'density_H2O.csv';
%entry from the table
opts=detectImportOptions(csvFileName,'ReadVariableNames', false);
% preview(csvFileName,opts) %data file preview
table_density=readtable(csvFileName,opts);

%looking for the temperature range
T1=table_density{1,1};
T2=table_density{1,2};
T3=table_density{2,1};
T4=table_density{2,2};

if(T>=T1 && T<=T2) %[output:group:8d641a98]
    str=table_density{1,3};
    rho_Water=eval(str{1})
elseif(T>=T3 && T<=T4)
    str=table_density{2,3};
    rho_Water=eval(str{1}) %[output:452a11b7]
else
    error('The temperature of your system is not in the range of COMSOL')
end %[output:group:8d641a98]

%[text] ### Evaluating the input flow rate for a given pressure drop  
%[text] **Description:** This block assumes a syringe is connected to the inlet of the pipe and introduces a constant flow rate Q. The pressure formula follows the Hagenâ€“Poiseuille equation \[1, Eq. (3.1) and Table 3.1 pp. 43\]
%[text] $\\Delta P=\\frac{8\\mu L Q}{\\pi r^4}$,
%[text] where 
%[text] $\\mu$ is the water viscosity,
%[text] $L$ is the channel length,
%[text] $r$ is the radius of the pipe.
% Q_nL_per_min=10;
% Q=Q_nL_per_min*10^(-9)*10^(-3)/60;
% Delta_P=(8*mu_Water*L_outer)/(pi*radius_cylinder_1^4)*Q
% Delta_P_mmHg=Delta_P/133.322
%flow rate in [m^3/s]
Q_L_s=p0*(pi*radius_cylinder_1^4)/(8*mu_Water*L_outer) %[output:933b8f30]
%flow rate in [uL/min]
Q_uL_m=Q_L_s*60/(1e-6*1e-3) %[output:95b3ed44]
%flow rate in [nL/min]
Q_nL_m=Q_L_s*60/(1e-9*1e-3) %[output:30871cf4]
%[text] ## Laminar Flow
%[text] ### Evaluating the flow velocity
%[text] **Description**: This section evaluates the profile velocity from theoretical formulations, which follows the Poiseuile flow. This block also contrasts results with the numerical simulation in COMSOL. The theoretcial velocity profile of the fluid within the pipe yields \[2, Eq. 4.9 pag. 54\]
%[text] $v(r)=\\frac{\\Delta p}{2\\mu L}(2ry-y^2)$,
%[text] where $\\Delta p$ is the inlet pressure, $\\mu$ is the viscosity of the medium (water), $L$ is the length(width) of the pipe, $a$ is the radius of the pipe, and $r$ is the radial-axis coordinates. The case $r=0$ denotes the center in the cross-sectional area of the pipe.
%[text] When the inlet speed is given, it specifies the average velocity at the center of the pipe, here denoted as $\\bar{v}$, and defined as $\\bar{v}=\\int\_0^{a}{v(r)dr}=\\frac{2}{3}v\_\\mathrm{m}$. In such a case, the resulting preasure is 
%[text] $\\Delta p=\\frac{3\\mu L\\bar{v}}{a^2}$,
%[text] and the velocity profile can be alternatively evaluated as
%[text] $v(r)=\\frac{3\\bar{v}}{2a^2}(a^2-r^2)$
%[text] #### Numerical evaluation in COMSOL
%reading the velocity profile in COMSOL
% Specify the MAT file for the velocity
csvFileName = 'velocity_vs_r.csv';
%entry from the table
opts=detectImportOptions(csvFileName,'ReadVariableNames', false);
% preview(csvFileName,opts) %data file preview
table_velocity=readtable(csvFileName,opts);
%extracting the y-axis, this axis is shifted to the left to match the
%theoretical formulation
y_axis=table_velocity.Var2;
%the values are ordered, as COMSOL returns those unsorted
[y_axis,idx]=sort(y_axis);
v_vs_r_COMSOL=table_velocity.Var3(idx);
v_center_COMSOL=max(table_velocity.Var3) %[output:84ad7e55]
v_mean_COMSOL=mean(table_velocity.Var3) %[output:34702c5c]

%[text] #### Theoretical evaluation given the inlet velocity
% syms y v
% %Given the Inlet velocity in COMSOL we evaluate the average pressure as
% p0_theo=3*mu_Water*L_inner*v_mean_COMSOL/radius_cylinder_1^2;
% %p0=8*mu_Water*L*v0/radius_cylinder_1^2;
% %For the velocity profile we follow [1, Eq. (2.33a) pp.28] except for a
% %factor of 2. This factor is correctly stated in [2, Eq. 4.9 pag. 54]
% v(y)=p0_theo/(2*mu_Water*L_inner)*(2*radius_cylinder_1*y-y^2);
% 
% v_center=double(v(radius_cylinder_1))
% %[1, Eq. (2.33a) pp.28]
% v_mean=double(int(v(y),y,0,2*radius_cylinder_1)/(2*radius_cylinder_1))

%[text] #### Theoretical evaluation given the inlet pressure
syms y v
%Given the Inlet velocity in COMSOL we evaluate the average pressure as [2, pag. 54]
p0_theo=8*mu_Water*L_inner*v_center_COMSOL/((2*radius_cylinder_1)^2) %[output:4a8588d5]
p0_COMSOL=p0 %[output:767943d2]
%Evaluating the velocity profile [2, Eq. 4.9 pag. 54]
v(y)=p0_theo/(2*mu_Water*L_inner)*(2*radius_cylinder_1*y-y^2);
% v(y)=4*v_center_COMSOL/((2*radius_cylinder_1)^2)*(2*radius_cylinder_1*y-y^2);

v_center=double(v(radius_cylinder_1)) %[output:2517f4d3]
v_center_COMSOL %[output:9e055e6a]
%[1, Eq. (2.33a) pp.28]
v_mean=double(int(v(y),y,0,2*radius_cylinder_1)/(2*radius_cylinder_1)) %[output:7fb35544]
v_mean_COMSOL %[output:3957414e]

figure; %[output:1de04a4b]
r_vector=linspace(0,2*radius_cylinder_1,100);
plot(r_vector*10^6,double(subs(v,y,r_vector))*10^3,'LineWidth',2); grid on; hold on %[output:1de04a4b]
plot(y_axis*10^6,v_vs_r_COMSOL*10^3,'o--','LineWidth',2,'MarkerIndices',1:5:length(v_vs_r_COMSOL),'MarkerSize',8); %[output:1de04a4b]
xlabel('$y$-axis [$\mu$m]','Interpreter','latex'); %[output:1de04a4b]
ylabel ('Velocity [cm/s]','Interpreter','latex'); %[output:1de04a4b]
legend('Theoretical formulation','COMSOL simulation') %[output:1de04a4b]
set(gca,'FontSize',fontsize); %[output:1de04a4b]
%[text] ## Transport of Diluted Species
%[text] ### Evaluating the Reynold number
%[text] **Description:** The Reynold ($\\mathrm{Re}$) number defines the ratio of inertial and viscous forces. In a microfluidic environment, where the fluid is expected to be laminar, the viscous forces dominate. Thereby we expect $\\mathrm{Re}\<1$.
%We evaluate the characteristic fluid speed as the mean of the fluid
v_char=(v_mean) %[output:3473e7bc]
%We evaluate the characteristic fluid speed as the arithmetic average of
%the center and mean spead of the fluid
% v_char=sqrt(v_center*v_mean)
% v_char=sqrt(v_center_COMSOL*v_mean_COMSOL)
%This evaluation follows [1, Eq. (3.36) pp. 52]
Re=rho_Water/mu_Water*v_char*2*radius_cylinder_1 %[output:6e0a8345]
%[text] ### Evaluating the PÃ©clet number
%[text] **Description**: The PÃ©clet ($Pe$) number defines the ratio (diffusion time)/(convection time). This ratio defines wheter diffusion or convection dominates. If the convection time is less than diffussion, then the particles haven't diffused within the convection time interval, in this case $Pe\<1$. Whenever the convection time is larger than diffusion, it means that the particles has diffused before the convection time, i.e., $Pe\>1$. The PÃ©clet number is analyzed taking the diffusion time as the one needed for the particles to travel along the radius of the microfluid, i.e., given by $\\tau\_\\mathrm{diff}^r=\\frac{r^2}{D}$, where $r$ is the radius of the microfluidic pipe and $D$ is the diffusion coefficient of the particle. Similarly, is for the convection time, given by $\\tau\_\\mathrm{conv}^r=\\frac{r}{V\_0}$, where $V\_0$ is the average fluid velocity within the Pouseille flow.
%This evaluation follows [1,Eq. (4.44) pp.75]
Pe=radius_cylinder_1*v_char/D_CH3COOH %[output:064c9879]

%[text] The particles are observed (at any point in x-axis) to diffuse homogenously whenever the condition $Pe\\ll \\frac{4L}{r}$ is met, where $L$ is the length of the microfluidic channel; see \[1, Eq. (4.52) pp. 77\]. Besides, diffusion effectively ocurred at any observation point $x$ whenever the dispersion coefficient satisfies $D\_\\mathrm{eff}\\gg D$, where $D\_\\mathrm{eff}=\\frac{r^2V\_0^2}{48D}$ or $Pe\\ll \\sqrt{48}$; see \[1, Eq.(4.54) pp.77\].  Both conditions entails the relation:
%[text] 
%[text] $\\sqrt{48}\\ll Pe \\ll 4\\frac{L}{r}$.       (1)
%[text] 
if(Pe<4*L_inner/radius_cylinder_1) %[output:group:935516cc]
    disp(['Concentration is constant along the x-axis']) %[output:4defcce7]
else
    disp(['Concentration is not constant along the x-axis, Pe=',num2str(Pe),' is larger than ',num2str(4*L_inner/radius_cylinder_1)])
end %[output:group:935516cc]

if(Pe>sqrt(48)) %[output:group:456cfab7]
    disp(['Diffusion occurred along the radial axis']) %[output:143d581f]
else
    disp(['Diffusion hasn''t occurred along the axis, Pe=',num2str(Pe),' is less than ',num2str(sqrt(48))])
end %[output:group:456cfab7]
%[text] ### Evaluating the Effective Diffusion
%[1, Eq.(4.54) pp.77]
D_eff=radius_cylinder_1^2*v_char^2/48/D_CH3COOH %[output:427addd8]

%Evaluating the dispersion along the x axis
radius_cylinder_1^2/D_CH3COOH %[output:1f60cd19]
%Evaluating the dispersion along the x axis
L^2/D_CH3COOH %[output:0154b6b9]
%[text] ### Straight Pipe: Evaluating the concentration level
%[text] **Description**: This section evaluates the concentration level observed at the ouptup of the rectangular pipes (straigth and turning). The evaluation is performed theoretical and following the simulations provided by COMSOL. Following COMSOL simulation we have the following files
%[text] - `CH3COOH_versus_L.csv`: This file stores the average concentration for the outlet line, which is placed at `L_inner` in the $x$ axis. The first column is time, and the concentration values are stored in the second column. \
%[text] #### Theoretical evaluation of concentration in the straight channel
%[text] **Description:** Regarding the theoretical calculation we follow the Taylor's model, see \[1, Sec. 4.5\]. Whenever the PÃ©clet number fulfill the condition in the above Eq. (1), the particles difussion is homogeneous along the $x$-axis and can be evaluated with the non-convection condition, i.e., free difussion in moved coordinate system. For the free difussion scenario, we regard to the case where there the diffusing substance concentrated initially on the negative side of $x'$, where $x'$ refers to the moving coordinates. The moving coordinates is along the $x$ axis of the unmoved coordinates and moves at the average speed of the velocity profile. Considering the initial conditions \[3, Sec. 2.2.3 pp. 13\]
%[text] $C=C\_0$, $x'\<0$, $C=0$, $x'\>0$, $t=0$,
%[text] the solution to the diffusion equation yields \[3, Eq. (2.14)\]
%[text] $C(x',t)=\\frac{1}{2}C\_0\\, \\mathrm{erfc}\\frac{x'}{2\\sqrt{Dt}}$.             (2)
%[text] Then, within the moved coordinate system $x'=x-v\_0t$ and $D=D\_\\mathrm{eff}$, yielding
%[text] $C(x,t)=\\frac{1}{2}C\_0\\, \\mathrm{erfc}\\frac{x-v\_0t}{2\\sqrt{D\_\\mathrm{eff}\\,t}}$,          (3)
%[text] where \[1, Eq. (4.54) pp. 77\]
%[text] $D\_\\mathrm{eff}=\\frac{a^2v\_0^2}{48D}$,                                   (4)
%[text] is the effective diffusion coefficient, and $v\_0$ is the characteristic speed, here given as the average speed within the microfluidic pipe.
%Theoretical calculation
L=L_inner;%selecting the proper distance
%Matlab code to evaluate the integral
syms t z x Delta_r rd real
c=c_CH3COOH_ini*1./2.*erfc((L-v_char*t)./(2*sqrt(D_eff*t)));

%Numerical evaluation with COMSOL
% Specify the MAT file for the concentration at the outlet
csvFileName = 'CH3COOH_versus_L.csv';
%entry from the table
opts=detectImportOptions(csvFileName,'ReadVariableNames', false);
% preview(csvFileName,opts) %data file preview
table_csv=readtable(csvFileName,opts);
time=table_csv.Var1;
c_CH3COOH_COMSOL=table_csv.Var2;

figure; %[output:124f156a]
plot((time+time_delta)*10^3,subs(c,t, time+time_delta),'LineWidth',2); grid on; hold on; %[output:124f156a]
plot(time(2:end)*10^3,c_CH3COOH_COMSOL(2:end),'o--','MarkerIndices',1:60:length(c_CH3COOH_COMSOL),'LineWidth',2); %[output:124f156a]
% plot((time+time_delta)*10^3,gradient(double(subs(c,t, time+time_delta)),time_delta),'LineWidth',2); grid on; hold on;
% plot(time(2:end)*10^3,gradient(c_CH3COOH_COMSOL(2:end),time_delta),'--','MarkerIndices',1:400:length(c_CH3COOH_COMSOL),'LineWidth',2);
xlabel('Time [ms]','Interpreter','latex'); %[output:124f156a]
ylabel ('Concentration [mol/m$^3$]','Interpreter','latex'); %[output:124f156a]
set(gca,'FontSize',fontsize); %[output:124f156a]
legend('Theoretical formulation','COMSOL simulation'); %[output:124f156a]
% axis([0 time_simul*10^3 0 c_CH3COOH_ini*1.1])
axis([0 time(end)*10^3 0 c_CH3COOH_ini*1.1]) %[output:124f156a]
%[text] ### Turning Pipe: Evaluating the concentration level
%[text] **Description**: This block evaluates the concentration level for a turning pipe with the analytic formulation and validates results with the simulation in COMSOL. The COMSOL simulation includes a straigth pipe with an oblique outlet and turning pipe. The flies are the following
%[text] - `concentration_step_outlet_turn_rectangle.csv`: This file stores the average concentration for the oblique outlet in a straight pipe. The oblique segment starts at `L_inner` in the $x$ axis and ends at `L_outer`. The first column is time, and the concentration values are stored in the third column.
%[text] - `concentration_step_outlet_turn.csv`: This file stores the average concentration for the inclined outlet line. This line develops a similar condition to the outlet of the turning channel. \
%[text] #### Theoretical formulation
%[text] The turning channel introduces the racetrack effect, as such, the turn is also similar to introducing an additional space-shift in the $x$-coordinate on the straight pipe. As the concentration solution en Eq. (3) is valid regardless $y$,  each lamina after the turn will be delayed in the amount $l-l\_\\mathrm{in}=\\phi r\_l - \\phi r\_\\mathrm{in}=\\phi \\Delta r\_l$, where $l$ refers to the length of the arcus on a given lamina, $\\phi$ is the angle of the turn and $r\_l$ is the radius of the arc. As such, Eq.(3) after a turn becomes
%[text] $C(x,t)=\\frac{1}{2 r}\\int\_{r\_\\Delta=0}^{r\_\\Delta=2r}\\frac{1}{2}C\_0\\, \\mathrm{erfc}\\left(\\frac{x-v\_0t-\\phi r\_\\Delta}{2\\sqrt{D\_\\mathrm{eff}\\,t}}\\right)dr\_\\Delta$ (5)
%[text] which is evaluated after using the primitive of this integral as
%[text] $\\int{\\mathrm{erfc}(x)dx}=x\\cdot\\mathrm{erfc}(x)-\\frac{e^{-x^2}}{\\sqrt{\\pi}}$ (6)
%[text] 
%Matlab code to evaluate the integral
syms t x r_d r rd v varphi D C_0

% Define the substitution for x
z = (x - v*t + varphi*r_d) / (2*sqrt(D*t));

% Define the integrand
integrand = 1/2*C_0*erfc(z);

% Perform the symbolic integration from r = 0 to r = dr
I = simplify(1/(2*r)*int(integrand, r_d, 0, 2*r));

% Display the result
disp('The integral of erfc(z) from r = 0 to r = 2r is:') %[output:18ff5e65]
disp(I) %[output:312628c5]
% disp(collect(I,))
disp(latex(I)) %[output:4378a06c]
%illustrating the primitive of the integral
disp(latex(1/(2*r)*int(integrand))) %[output:206650e0]


%Evaluating the function numerically
I_value=subs(I,[v,x,D,C_0,varphi,r],[v_char,L_inner,D_eff,c_CH3COOH_ini,(angle_turn_1_rad),radius_cylinder_1]);
% %Printing the numeric function with precision of two digits
% I_value_vpa=vpa(I_value,2)

% Second way (equivalent) to evaluate the integral
% c_y=c_CH3COOH_ini*1./2.*erfc((L_inner-v_char*t+(varphi)*r_d)./(2*sqrt(D_eff*t)));
% I_c_y=(1/(2*r)*int(c_y, r_d, 0, 2*r));
% I_c_y_t=subs(I_c_y,[r,varphi],[radius_cylinder_1,angle_turn_1_rad]);

%Validating the reduced closed-form expression
% c_avg=1/(2*r)*int(integrand)
c_avg=C_0/(4*r)*(erfc((x-t*v+varphi*r_d)/(2*sqrt(D*t)))*(x-t*v+varphi*r_d)-2*sqrt(D*t/pi)*exp(-(x-t*v+varphi*r_d)^2/(2*sqrt(D*t))^2)) %[output:4fac1238]
%Replacing the constants
c_avg_value=subs(c_avg,[v,x,D,C_0,varphi,r],[v_char,L_inner,D_eff,c_CH3COOH_ini,(angle_turn_1_rad),radius_cylinder_1]);
%Evaluating the integral limits
c_avg_value_int=subs(c_avg_value,r_d,2*radius_cylinder_1)-subs(c_avg_value,r_d,0);

%Reading the concentration at the oblique outlet in the straight pipe
% Specify the MAT file for the concentration at the outlet
csvFileName = 'concentration_step_outlet_turn_rectangle.csv';
%entry from the table
opts=detectImportOptions(csvFileName,'ReadVariableNames', false);
% preview(csvFileName,opts) %data file preview
table_csv=readtable(csvFileName,opts);
c_CH3COOH_COMSOL_rect=table_csv.Var2;
time=table_csv.Var1;

%Reading the concentration at the Outlet in the turning pipe
% Specify the MAT file for the concentration at the outlet
csvFileName = 'concentration_step_outlet_turn.csv';
%entry from the table
opts=detectImportOptions(csvFileName,'ReadVariableNames', false);
% preview(csvFileName,opts) %data file preview
table_csv=readtable(csvFileName,opts);
c_CH3COOH_COMSOL_turn=table_csv.Var2;
time2=table_csv.Var1;

figure; %[output:6603c419]
plot((time+time_delta)*10^3,double(subs(c_avg_value_int,t, time+time_delta)),'LineWidth',2); grid on; hold on; %[output:6603c419]
% plot((time+time_delta)*10^3,double(subs(I_value,t, time+time_delta)),'LineWidth',2); grid on; hold on;
plot(time(2:end)*10^3,c_CH3COOH_COMSOL_rect(2:end),'--','MarkerIndices',1:60:length(c_CH3COOH_COMSOL),'LineWidth',2); hold on; grid on; %[output:6603c419]
plot(time2(2:end)*10^3,c_CH3COOH_COMSOL_turn(2:end),'--o','MarkerIndices',30:400:length(c_CH3COOH_COMSOL_turn),'LineWidth',2); %[output:6603c419]
xlabel('Time [ms]','Interpreter','latex'); %[output:6603c419]
