%%
%[text] ### Evaluating the impulse response in the turning channel
%[text] **Description:** This block evaluates the channel impulse response $h(t)$ for the turning channel. The $h(t)$ sequence is evaluated using the above formulation for the observed concentration of molecules. The above formulation is the step response of the channel when $C\_0=1$, as such, the channel impulse response can be evaluated as \[4, Eq. (7b), pp. 78\]
%[text] $h(t)=\\frac{\\partial}{\\partial t}C(x,t)\\bigg|\_{C\_0=1}$,  (7)
%[text] where $C(x,t)$ is given as in Eq. (5) above.
%[text]  
%evaluating the linear transformation
h=diff(subs(c_avg,[r_d,C_0],[2*radius_cylinder_1,1])-subs(c_avg,[r_d,C_0],[0,1]),t) %[output:8fc84eec]

% Evaluating h(t) for two different distances
L_factor=1.5;%factor to evaluate the second distance
h_value_L_1=subs(h,[v,x,D,varphi,r],[v_char,L_inner,D_eff,(angle_turn_1_rad),radius_cylinder_1]);
h_value_L_2=subs(h,[v,x,D,varphi,r],[v_char,L_factor*L_inner,D_eff,(angle_turn_1_rad),radius_cylinder_1]);
%evaluating the channel impulse response with time
h_value_vector_L_1=double(subs(h_value_L_1,t, time+time_delta));
h_value_vector_L_2=double(subs(h_value_L_2,t, time+time_delta));

% Evaluating h(t) for two different turning angles
varphi_factor=2;%factor  to evaluate the second angle
h_value_varphi_1=subs(h,[v,x,D,varphi,r],[v_char,L_inner,D_eff,(angle_turn_1_rad),radius_cylinder_1]);
h_value_varphi_2=subs(h,[v,x,D,varphi,r],[v_char,L_inner,D_eff,varphi_factor*(angle_turn_1_rad),radius_cylinder_1]);
%evaluating the channel impulse response with time
h_value_vector_varhpi_1=double(subs(h_value_varphi_1,t, time+time_delta));
h_value_vector_varphi_2=double(subs(h_value_varphi_2,t, time+time_delta));

%%

figure; %[output:0375097a]
plot((time+time_delta)*10^3,h_value_vector_L_1,'LineWidth',2); grid on; hold on; %[output:0375097a]
plot((time+time_delta)*10^3,h_value_vector_L_2,'--','LineWidth',2); %[output:0375097a]
xlabel('Time [ms]','Interpreter','latex'); %[output:0375097a]
ylabel ('$h(t)$','Interpreter','latex'); %[output:0375097a]
set(gca,'FontSize',fontsize); %[output:0375097a]
legend({strcat('$L=',num2str(L_inner*10^3,1),'$ mm'),... %[output:0375097a]
       strcat('$L=',num2str(L_factor*L_inner*10^3,1),'$ mm')},'Interpreter','latex') %[output:0375097a]
axis([0 time(end)*10^3 0 max(h_value_vector_L_1)*1.1]) %[output:0375097a]

figure; %[output:375bab04]
plot((time+time_delta)*10^3,h_value_vector_varhpi_1,'LineWidth',2); grid on; hold on; %[output:375bab04]
plot((time+time_delta)*10^3,h_value_vector_varphi_2,'--','LineWidth',2); %[output:375bab04]
xlabel('Time [ms]','Interpreter','latex'); %[output:375bab04]
ylabel ('$h(t)$','Interpreter','latex'); %[output:375bab04]
set(gca,'FontSize',fontsize); %[output:375bab04]
legend({strcat('$\varphi=\frac{\pi}{',num2str(pi/angle_turn_1_rad),'}$ rad'),... %[output:375bab04]
        strcat('$\varphi=',num2str(varphi_factor),'\frac{\pi}{',num2str(pi/angle_turn_1_rad),'}$ rad')},'Interpreter','latex') %[output:375bab04]
axis([0 time(end)*10^3 0 max(h_value_vector_varphi_2)*1.1]) %[output:375bab04]
